INSERT INTO `song` (`id`, `artist_id`, `disc_id`, `disc_order`, `title`, `description`, `release_time`, `year`, `price`, `price_type`, `genre`, `lyric`, `distribution_lyric`, `total_sec`, `artist_name`, `song_composer`, `lyricist`, `producer`, `label`, `isrc_code`, `radio_playable`, `is_released`, `is_deleted`, `create_time`, `modify_time`, `delete_time`) VALUES
(6034, 536, 723, 2, 'You Don''t Know Me', '', '2006-04-04 00:00:00', 0000, 0, 1, 5, '假如我是你的新遊戲\r\n也請你玩到筋疲力盡\r\n假如我是廉價的玩具\r\n請你也仔細閱讀使用說明\r\n\r\nYou’re talking all about me\r\nYou’re watching all about me\r\nYou’re hearing all about me\r\nBaby, you don’t know me\r\n\r\n假如我是你玩膩的遊戲\r\n也請你認識我的姓名\r\n假如我是你唱膩的歌曲\r\n請你也每個字句念仔細\r\n\r\nYou’re talking all about me\r\nYou’re watching all about me\r\nYou’re hearing all about me\r\nBaby, you don’t know me\r\n\r\n你總是瞭解所有的天文和地理\r\n你總是談論誰和誰之間的秘密\r\n你總是預言明天要發生的事情\r\n你自己到底在哪裡\r\n\r\nYou’re talking all about me\r\nYou’re watching all about me\r\nYou’re hearing all about me\r\nBaby, you don’t know me ', '', 192, '', '小狼', '小狼', '壞壞芽', '', '', 0, 1, 0, '2008-06-24 03:11:22', '2015-03-12 13:33:17', '0000-00-00 00:00:00'),
(6035, 536, 723, 3, '不分', '', '2006-04-04 00:00:00', 0000, 0, 1, 5, '你\r\n你要照顧你的\r\n你要擦乾淚痕\r\n你的手要有力　要堅強撐著\r\n你　你是穩重的\r\n是不怕蟑螂的\r\n是領在前頭　穿越黑夜的\r\n\r\n啦啦啦\r\n\r\n你\r\n你要細嫩可疼\r\n你總笑臉迎人\r\n你要嬌小如燕　被緊緊摟著\r\n你　你總要青春\r\n是不會老去的\r\n要召喚春光　be sweet forever\r\n\r\n啦啦啦\r\n\r\n能不能自由穿梭\r\n不被圍牆隔成一半\r\n不被秤在兩端\r\n能不能保持完整\r\n不被從中一刀切開\r\n\r\n啦啦啦\r\n\r\n能不能自由穿脫\r\n不被形象綁住軀殼\r\n不被重重鎖著\r\n能不能 ', '', 276, '', '小狼', '小狼', '壞壞芽', '', '', 0, 1, 0, '2008-06-24 03:12:49', '2015-03-12 13:33:17', '0000-00-00 00:00:00'),
(6036, 536, 723, 4, '我的', '', '2006-04-04 00:00:00', 0000, 0, 1, 5, 'I\r\n我的眼睛　都腫了\r\n我的嘴唇　都裂了\r\n我的牙齦　都軟弱了\r\n我的耳朵　都荒廢了\r\n\r\n我的淚水　都不知分寸\r\n我的鼻子　都迷路了\r\n我的嘴角　都累積傷痕\r\n我的皮膚　都不怕冷\r\n\r\nII\r\n我的手指　在唱歌\r\n我的腸胃　厭倦了\r\n我的手心　都乾涸了\r\n我的膝蓋　都脫軌了\r\n\r\n我的身體　都爬滿青藤\r\n我的腳底　都發熱了\r\n我的心跳　都幾番波折\r\n我的血液　都凍結了\r\n\r\nIII\r\n我的電影　下檔了\r\n我的舞台　落幕了\r\n我的詩句　都蒙上灰塵\r\n我的音樂　在播放著\r\n\r\n我的情節　都失去規則\r\n我的假期　都埋葬了\r\n我的記憶　都鎖上了門\r\n我的自己　都對著鏡子微笑了 ', '', 313, '', '小狼', '小狼', '壞壞芽', '', '', 0, 1, 0, '2008-06-24 03:14:10', '2015-03-12 13:33:17', '0000-00-00 00:00:00'),
(6037, 536, 723, 5, 'Relationship', '', '2006-04-04 00:00:00', 0000, 0, 1, 5, '魔鬼的咒語\r\n一句句刻鑄在基因裡\r\n從不能抹去\r\n也無法丟棄\r\n\r\n狂暴的血液\r\n一絲絲懸浮在空氣裡\r\n血液流遍了我的身體\r\n卻搆不著地\r\n\r\n學不會平靜\r\n發不出該有的聲音\r\n\r\nNowhere could escape from it\r\nNo way could deny it\r\n聽著音樂大口呼吸\r\n去尋找自己的天地\r\n\r\n找一個自己的天地\r\n不論是什麼樣的天地 ', '', 256, '', '小狼', '小狼', '壞壞芽', '', '', 0, 1, 0, '2008-06-24 03:16:12', '2015-03-12 13:33:17', '0000-00-00 00:00:00'),
(6038, 536, 723, 6, '斷線', '', '2006-04-04 00:00:00', 0000, 0, 1, 5, '我不插電\r\n我沒有插電\r\n我的腦袋搭不上所有人的肩\r\n\r\n我無所謂\r\n我沒有所謂\r\n我的心思不需要所有人看見\r\n\r\n拔斷了接在太陽穴的網路線\r\n我就要消失在形而上的世界\r\n拔斷了接在太陽穴的網路線\r\n我就要淹沒在1與0的世界\r\n\r\n我不插電\r\n我不插電\r\n我不插電\r\n我無所謂\r\n我無所謂\r\n我的心思不需要所有人看見 ', '', 194, '', '小狼', '小狼', '壞壞芽', '', '', 0, 1, 0, '2008-06-24 03:17:55', '2015-03-12 13:33:17', '0000-00-00 00:00:00'),
(6039, 536, 723, 7, 'Out', '', '2006-04-04 00:00:00', 0000, 0, 1, 5, '睜大你的我的眼睛看這一切\r\n看電視報紙　看多數決\r\n張大你的我的嘴巴絮叨不歇\r\n誰高分貝　誰就搶去版面\r\n\r\n面對廣漠星空　如此害怕孤立\r\n一個人沒有力氣頂天立地\r\n拿太陽作圓心　保持固定距離\r\n迷路要看北極星　都是人說的規矩\r\n\r\n你說ＹＥＳ　就浮出水面\r\n我說　ＮＯ　就節節下墜\r\n跳一支舞　繞著螺旋\r\nＳＰＩＲＡＬ　ＳＰＩＲＡＬ\r\n葬在沉默的海裡面 ', '', 86, '', '小狼', '小狼', '壞壞芽', '', '', 0, 1, 0, '2008-06-24 03:19:39', '2015-03-12 13:33:17', '0000-00-00 00:00:00'),
(6040, 536, 0, 1, '喜歡你(DEMO)', '口風琴由雅文老酥友情贊助', '0000-00-00 00:00:00', 0000, 15, 1, 5, '喜歡你\r\n所以用眼角餘光觀察你\r\n衡量你頭髮的長度\r\n一首唱不完的歌\r\n是不是我們之間的距離？\r\n\r\n喜歡你\r\n兩個人在一起\r\n不說任何話也可以\r\n像大片大片蔚藍的天空\r\n每朵雲都是我內心的詩句\r\n\r\n而我站在畫面的角落裡\r\n聽著那風聲和小蟲鳴\r\n而我站在回憶的角落裡\r\n聽著你賣弄你的小聰明\r\n\r\n如果青春是綠色草原那般綠\r\n失去你的長大就是灰色的東京\r\n被高架橋和電線割裂的天空\r\n留下我一人就像寒夜裡，孤獨的星\r\n\r\n當我們再次重逢的時候\r\n是灰濛濛看不見藍天的天氣\r\n我雖然猜透了你說的唇語\r\n但你心上那朵雲又飄到哪裡？ ', '', 278, '', '雍小狼', '雍小狼', '壞壞芽', '', '', 0, 1, 0, '2008-06-24 03:31:31', '2015-03-12 13:33:17', '0000-00-00 00:00:00'),
(6041, 536, 0, 1, '連續劇(DEMO)', '', '0000-00-00 00:00:00', 0000, 15, 1, 5, '在伸手可及的距離裡\r\n不咬一口就顯得太可惜\r\n於是通俗的劇情裡\r\n你悄悄地跟著我來\r\n我再悄悄地把你拋棄\r\n\r\n如果愛是不能夠丟棄\r\n應該收在床頭櫃的第幾個抽屜？\r\n最後就像所有的紀念品\r\n變成不實用又佔空間的東西\r\n\r\n像那種　每日每週的隱形眼鏡\r\n本質上也是不久的\r\n輕輕搓揉就破碎的\r\n洗不淨令人淚滴滴 ', '', 346, '', '雍小狼, 胡Luba', '雍小狼', '壞壞芽', '', '', 0, 1, 0, '2008-06-24 03:39:11', '2015-03-12 13:33:17', '0000-00-00 00:00:00'),
(6042, 536, 0, 2, '壞壞芽(DEMO)', '', '0000-00-00 00:00:00', 0000, 15, 1, 5, '有一天　我的心臟長出了壞壞的小芽\r\n從此後　我已不會再是個乖寶寶榜樣\r\n再也不守規章　再也不聽勸話\r\n一點　一點　慢慢踏出步伐\r\n開心會笑哈哈　難過會大聲地唱\r\n\r\n電視上　每個人都在重複大人說的話\r\n他們說　我們的人生通通寫在參考書上\r\n男生要有擔當　女生要像朵花\r\n小孩　老人　都要被關在家\r\n不能有性幻想　只能夠乖乖地生娃娃\r\n\r\n壞壞的小芽　幫助我們看這個世界能夠更清楚呀\r\n壞壞的小芽　幫助我們在花花綠綠的人海中不偽裝\r\n壞壞的小芽　幫助我們在公共場合能夠大聲說話\r\n在這世界上　壞壞才能長大 ', '', 221, '', '雍小狼', '雍小狼', '壞壞芽', '', '', 0, 0, 1, '2008-06-24 03:42:51', '2013-10-07 17:12:37', '0000-00-00 00:00:00'),
(6043, 536, 0, 1, '壞壞芽(DEMO)', '', '0000-00-00 00:00:00', 0000, 15, 1, 5, '有一天　我的心臟長出了壞壞的小芽\r\n從此後　我已不會再是個乖寶寶榜樣\r\n再也不守規章　再也不聽勸話\r\n一點　一點　慢慢踏出步伐\r\n開心會笑哈哈　難過會大聲地唱\r\n\r\n電視上　每個人都在重複大人說的話\r\n他們說　我們的人生通通寫在參考書上\r\n男生要有擔當　女生要像朵花\r\n小孩　老人　都要被關在家\r\n不能有性幻想　只能夠乖乖地生娃娃\r\n\r\n壞壞的小芽　幫助我們看這個世界能夠更清楚呀\r\n壞壞的小芽　幫助我們在花花綠綠的人海中不偽裝\r\n壞壞的小芽　幫助我們在公共場合能夠大聲說話\r\n在這世界上　壞壞才能長大 ', '', 215, '', '雍小狼', '雍小狼', '壞壞芽', '', '', 0, 1, 0, '2008-06-24 03:59:38', '2015-03-12 13:33:18', '0000-00-00 00:00:00'),
(6044, 536, 0, 1, '青狂', 'Guest Guitar: Dissappears', '0000-00-00 00:00:00', 0000, 15, 1, 5, '多愁善感的年代過去啦\r\n我們也不年輕啦\r\n已不能在自己身上打一盞光\r\n假裝看不見世界啦\r\n\r\n青黃不接的年代過去啦\r\n小孩兒都成熟啦\r\n已不能再忘情耽溺於想像\r\n得過所謂的生活啦\r\n\r\n我主演的舞台我自己搭\r\n寫悲劇的歌自己唱\r\n每一個眼神都悽涼\r\n每一句話都潸然淚下', '', 254, '', '雍小狼', '雍小狼', '雍小狼', '', '', 0, 1, 0, '2008-06-24 04:03:22', '2015-03-12 13:33:18', '0000-00-00 00:00:00'),
(6045, 536, 0, 1, '瑪格麗特(DEMO)', 'Guest guitar: Dissappears', '0000-00-00 00:00:00', 0000, 15, 1, 5, '他是瑪格麗特\r\n在同伴間不很獨特\r\n他沒有濃郁香氛\r\n也沒有嬌豔顏色\r\n一朵白色的瑪格麗特\r\n\r\n瑪格麗特不是醉人的一杯酒\r\n冷冽的藍　迷離的嫣紅\r\n瑪格麗特不能擁抱都市的霓虹\r\n他屬於土壤　和清澈的河流\r\n\r\n瑪格麗特不看電視\r\n他看天上的雲朵\r\n瑪格麗特聽風訴說\r\n也享受蜜蜂親暱的撫弄\r\n\r\n喔　瑪格麗特　你是一座小山\r\n喔　瑪格麗特　你不必是一片海', '', 113, '', '雍小狼', '雍小狼', '雍小狼', '', '', 0, 1, 0, '2008-06-24 04:08:36', '2015-03-12 13:33:18', '0000-00-00 00:00:00'),
(6046, 536, 0, 3, '青春無敵啦啦啦', 'Guest guitar: Dissappears\r\nGuest vocal: Coca', '0000-00-00 00:00:00', 0000, 15, 1, 5, '穿好你的水手服\r\n穿好你的學生褲\r\n學生證拿出來\r\n年齡不能盧\r\n\r\n年少青春最可愛\r\n老了不能裝可愛\r\n快去整型吧　快去健身吧\r\n殺死你/妳的皺紋跟白頭髮\r\n\r\n每個女生都是早安少女組\r\n每個男生都是Johnny’s Group\r\n不可愛就淘汰　別害怕認輸\r\n殺殺殺殺殺殺　殺光那些老屁股\r\n\r\n抓頭髮基本功夫\r\n背心搭上低腰褲\r\n聚光燈打出來\r\n夠閃亮才不會輸\r\n\r\n年少青春最可愛\r\n老了不能裝可愛\r\n快去整型吧　快去健身吧\r\n殺死你/妳的皺紋跟白頭髮\r\n\r\n每個女生都是早安少女組\r\n每個男生都是Johnny’s Group\r\n不可愛就淘汰　別害怕認輸\r\n殺殺殺殺殺殺　殺光那些老屁股\r\n\r\n殺死妳的小腿肚　殺死你的啤酒肚\r\n殺死你/妳的眼袋和鬆皺的皮膚\r\n\r\n每個女生都是早安少女組\r\n每個男生都是Johnny’s Group\r\n不可愛就淘汰　別害怕認輸\r\n殺殺殺殺殺殺　殺光那些老屁股', '', 234, '', '雍小狼', '雍小狼', '雍小狼', '', '', 0, 1, 0, '2008-06-24 04:13:56', '2015-03-12 13:33:18', '0000-00-00 00:00:00'),
(6047, 536, 0, 1, '放假了(DEMO)', 'For my dear Howz.', '0000-00-00 00:00:00', 0000, 15, 1, 5, '我要放一個假\r\n坐在你的肩膀\r\n拿你的臂彎　當作溜滑梯來滑\r\n拿你的胸膛　當作公園來玩耍\r\n你的眼睛是我的摩天輪\r\n我佔據兩座包廂\r\n向你內心眺望\r\n裡面是否有滿滿的我呀？\r\n\r\n啦啦啦啦　旋轉木馬是你的情話\r\n啦啦啦啦　你的留言讓我臉頰都發燙\r\n像碰碰車把我心都碰出來啦\r\n\r\n我要放一個假\r\n賴在你的大腿上\r\n張大了嘴巴　等你來餵我吃顆糖\r\n張大了耳朵　等你來跟我說悄悄話\r\n你的嘴角是我的海盜船\r\n心情隨它大幅擺盪\r\n呼吸也備受影響\r\n能不能一直停在最高的地方？\r\n\r\n啦啦啦啦　雲霄飛車是你的氣話\r\n啦啦啦啦　你的臭臉讓我手腳都凍僵\r\n抱我一下我的春天就回來啦\r\n\r\n啦啦啦啦　旋轉木馬是你的情話\r\n啦啦啦啦　你的留言讓我臉頰都發燙\r\n啦啦啦啦　雲霄飛車是你的氣話\r\n啦啦啦啦　你的臭臉讓我手腳都凍僵\r\n我春夏秋冬都繫在你的心上\r\n春夏秋冬都繫在你的心上 ', '', 197, '', '雍小狼', '雍小狼', '壞壞芽', '', '', 0, 1, 0, '2008-06-24 04:32:20', '2015-03-12 13:33:18', '0000-00-00 00:00:00'),
(6048, 146, 0, 1, '反覆安靜地', '我原本是在想一個輪迴的故事。最普通一般的那種。想我們可以一直活好幾輩子膩了也無法怎樣。所以，最想在這輩子留下的是什麼呢？其實整個來說我還是比較相信無法輪迴的。並沒有下個機會這種事情。最後會想用「反覆安靜地」這個名字是想說這個一再對於死亡的想像到底是什麼樣的感覺。這大概是我最近半年來最想不開的問題。', '0000-00-00 00:00:00', 0000, 20, 0, 7, '我曾是個輕盈的女孩\r\n必然得短暫離開\r\n我不需要告別和眼淚\r\n我盼著下個機會\r\n\r\n我曾是個虔誠的信徒\r\n準備擁抱痛苦\r\n我不害怕未知的領悟\r\n我背著智慧的書\r\n\r\n我曾渴望你\r\n最深最藍\r\n想像的海\r\n我曾清醒地\r\n觸摸黑暗\r\n如夢一般\r\n\r\n我相信我能再回來\r\n\r\n我有永恆的快樂\r\n時間不過是扇門\r\n我曾安心地躺著\r\n呼吸\r\n逐漸冰冷的體溫\r\n\r\n我曾逃過戰爭的摧殘\r\n忍受靈魂的傷害\r\n誰守著家鄉漫長的等待\r\n我只想回頭看\r\n\r\n我曾渴望你\r\n最深最藍\r\n想像的海\r\n我曾清醒地\r\n觸摸黑暗\r\n如夢一般\r\n\r\n我相信我能再回來\r\n\r\n我的靈魂和身體\r\n反覆安靜地分離\r\n我要我回到這裡\r\n真的\r\n我好不願意忘記你', '', 215, '', '鄭焙隆', '鄭焙隆', '', '', '', 1, 0, 0, '2008-06-24 14:56:09', '2015-03-12 13:33:18', '0000-00-00 00:00:00'),
