(6174, 721, 733, 4, '開始', '', '2008-06-26 00:00:00', 0000, 15, 0, 5, '', '從結束開始，\n從終點回頭，\n在孤獨午後，\n牽著我的手，\n來不及回憶，\n來不及嘆息，\n來不及誠實，\n找回我自己…\n\n閃動的念頭，遼闊，\n自由的飛，在那頭，\n難過的時候，想起我，不再閃躲…\n\n\n\n風輕輕吹過， \n午夜在閃爍，\n你聽見了嗎？\n沉默的傳說，\n閃動的念頭，遼闊，\n自由的飛，在那頭，\n難過的時候，想起我，不要閃躲…\n\n重新的探索，\n重新的生活，\n冒險的執著，\n嘗試了再說，\n在追尋什麼，\n屬於我的結果…\n', 431, '', '', '', '', '', '', 1, 1, 0, '2008-06-26 15:48:20', '2015-03-12 13:33:22', '0000-00-00 00:00:00'),
